import React, { useState } from 'react';

const Son = (props) => {
  let [state, setState] = useState(() => {
    if (props.init > 60) {
      console.log('大于60');
      return 60 * 60;
    }
  });
  return (
    <div>
      <h1>son组件</h1>
      <p>{state}</p>
      <button
        onClick={() => {
          setState(state + 10);
        }}
      >
        增加10
      </button>
    </div>
  );
};
export default function App() {
  return (
    <div>
      <Son init={70} />
    </div>
  );
}
